def extract_data(s):
    separators = ['', ',', ';']
    if s.isupper():
        return sum((1 for c in s if (ord(c) - ord('A')) % 2 == 0))
    if any((sep in s for sep in separators)):
        for sep in separators:
            s = s.replace(sep, ' ')
        return s.split()
    return {'upper': sum((c.isupper() for c in s)), 'lower': sum((c.islower() for c in s)), 'digits': sum((c.isdigit() for c in s)), 'others': sum((not c.isalnum() for c in s))}

